import React, {Component} from "react";
import "./aboutUs.scss";
import photo1 from './img/photo1.svg';


class AboutUs extends Component{
    render(){
        return(
            <div className="aboutUs">
              Hello world
              <img src={photo1}/>
            </div>
        )
    }
}

export default AboutUs
